('https://books.google.co.uk/books?id=TXc54LfKsSQC&pg=PA645&redir_esc=y#v=onepage&q&f=false', 174126, 3, 'Thread22', 171113, '2022-04-18 14:38:59', 1, 'Serious amateur astronomers often wonder how to find new minor planets, comets and novae and would like to know how to use photoelectric detectors to derive the temperatures of stars. These issues along with predicting future eclipses and the occultations of stars by minor planets are topics covered in this authoritative and wide-ranging guide. For each topic, sound practical methods of observation and the scientific background are given to facilitate better observations. Guidelines also show how to record and catalog observations using the recognized professional terminology and classification schemes. From the simplest pencil drawings of the moon to observations of the most distant galaxies with state-of-the-art CCD cameras and photoelectric photometers, this guide is packed with practical tips for all types of amateur observations. Volume 2 covers aurorae, meteors, double and multiple stars, variable stars, deep sky objects, novae, and supernovae.'),
