('https://bmcmedethics.biomedcentral.com/articles/10.1186/s12910-019-0406-6?&', 174171, 3, 'Thread23', 172391, '2022-04-18 14:39:01', 1, 'Since 2010 the People’s Republic of China has been engaged in an effort to reform its system of organ transplantation by developing a voluntary organ donation and allocation infrastructure. This has required a shift in the procurement of organs sourced from China’s prison and security apparatus to hospital-based voluntary donors declared dead by neurological and/or circulatory criteria. Chinese officials announced that from January 1, 2015, hospital-based donors would be the sole source of organs. This paper examines the availability, transparency, integrity, and consistency of China’s official transplant data. Forensic statistical methods were used to examine key deceased organ donation datasets from 2010 to 2018. Two central-level datasets — published by the China Organ Transplant Response System (COTRS) and the Red Cross Society of China — are tested for evidence of manipulation, including conformance to simple mathematical formulae, arbitrary internal ratios, the presence of anomalous data artefacts, and cross-consistency. Provincial-level data in five regions are tested for coherence, consistency, and plausibility, and individual hospital data in those provinces are examined for consistency with provincial-level data. COTRS data conforms almost precisely to a mathematical formula (which first appeared to be a general quadratic, but with further confirmatory data was discovered to be a simpler one-parameter quadratic) while Central Red Cross data mirrors it, albeit imperfectly. The analysis of both datasets suggests human-directed data manufacture and manipulation. Contradictory, implausible, or anomalous data artefacts were found in five provincial datasets, suggesting that these data may have been manipulated to enforce conformity with central quotas. A number of the distinctive features of China’s current organ procurement and allocation system are discussed, including apparent misclassification of nonvoluntary donors as voluntary. A variety of evidence points to what the authors believe can only be plausibly explained by systematic falsification and manipulation of official organ transplant datasets in China. Some apparently nonvoluntary donors also appear to be misclassified as voluntary. This takes place alongside genuine voluntary organ transplant activity, which is often incentivized by large cash payments. These findings are relevant for international interactions with China’s organ transplantation system.'),
